                OblivionGroup_FieldIndex enu = (OblivionGroup_FieldIndex)index;
                switch (enu)
                {
                    case OblivionGroup_FieldIndex.Type:
                        this.Type = (Exception?)obj;
                        break;
                    case OblivionGroup_FieldIndex.LastModified:
                        this.LastModified = (Exception?)obj;
                        break;
                    case OblivionGroup_FieldIndex.RecordCache:
                        this.RecordCache = (MaskItem<Exception?, IEnumerable<MaskItem<Exception?, T_ErrMask?>>?>)obj;
                        break;
                    default:
                        throw new ArgumentException($"Index is out of range: {index}");
                }
            }
        
            public bool IsInError()
            {
                if (Overall != null) return true;
                if (Type != null) return true;
                if (LastModified != null) return true;
                if (RecordCache != null) return true;
                return false;
            }
            #endregion
        
            #region To String
            public override string ToString() => this.Print();
        
            public void Print(StructuredStringBuilder sb, string? name = null)
            {
                sb.AppendLine($"{(name ?? "ErrorMask")} =>");
                using (sb.Brace())
                {
                    if (this.Overall != null)
                    {
                        sb.AppendLine("Overall =>");
                        using (sb.Brace())
                        {
                            sb.AppendLine($"{this.Overall}");
                        }
                    }
                    PrintFillInternal(sb);
                }
            }
            protected void PrintFillInternal(StructuredStringBuilder sb)
            {
                {
                    sb.AppendItem(Type, "Type");
                }
                {
                    sb.AppendItem(LastModified, "LastModified");
                }
                {
                    sb.AppendLine("RecordCache =>");
                    using (sb.Brace())
                    {
                        if (RecordCache != null)
                        {
                            if (RecordCache.Overall != null)
                            {
                                sb.AppendLine(RecordCache.Overall.ToString());
                            }
                            if (RecordCache.Specific != null)
                            {
                                foreach (var subItem in RecordCache.Specific)
                                {
                                    using (sb.Brace())
                                    {
                                        {
                                            sb.AppendItem(subItem);
                                        }
                                    }
                                }
                            }
                        }
                    }
                }
            }
            #endregion
        
            #region Combine
            public ErrorMask<T_ErrMask> Combine(ErrorMask<T_ErrMask>? rhs)
            {
                if (rhs == null) return this;
                var ret = new ErrorMask<T_ErrMask>();
                ret.Type = this.Type.Combine(rhs.Type);
                ret.LastModified = this.LastModified.Combine(rhs.LastModified);
                ret.RecordCache = new MaskItem<Exception?, IEnumerable<MaskItem<Exception?, T_ErrMask?>>?>(Noggog.ExceptionExt.Combine(this.RecordCache?.Overall, rhs.RecordCache?.Overall), Noggog.ExceptionExt.Combine(this.RecordCache?.Specific, rhs.RecordCache?.Specific));
                return ret;
            }
            public static ErrorMask<T_ErrMask>? Combine(ErrorMask<T_ErrMask>? lhs, ErrorMask<T_ErrMask>? rhs)
            {
                if (lhs != null && rhs != null) return lhs.Combine(rhs);
                return lhs ?? rhs;
            }
            #endregion
        
            #region Factory
            public static ErrorMask<T_ErrMask> Factory(ErrorMaskBuilder errorMask)
            {
                return new ErrorMask<T_ErrMask>();
            }
            #endregion
        
